import React, {Component} from "react";
import "./artist.scss";



class Artist extends Component {
    render() {
        return (
            <div>
                {this.props.name}
                <a href={this.props.video} target="blank">
                    <img src={require(this.props.photo)}/>
                </a>
                <p>
                    {this.props.description}
                </p>
            </div>
        )
    }
}



export default Artist;
